import { useState} from 'react'
import './App.css';
import Content from './components/Content';

function App() {
  const [theme,setTheme] = useState('dark')
  const handleTheme = () =>{
    setTheme(theme === 'dark' ? 'light' : 'dark')
  }
  return (
    <div className="App">
      <h1>Hello world</h1>
      <button onClick={handleTheme}>Toggle theme</button>
      <Content theme={theme}/>
    </div>
  );
}

export default App;
